import Array from './Arraypics'
import { useState } from 'react'

export default function Projects() {

      const [hovera , sethover]=useState(false);

      const mouse=(data)=>{
            console.log(data)
            sethover(!hovera);
      }
      
  return (
    <div className='Projects mainabout'>
       
    <h1 data-aos='flip-right'>Projects</h1>

    <div className='proimages '>{Array.map((val)=>{
return(
     <>
      <div className="imagess" onClick={()=>mouse(val)}><img src={val.image} alt="" />  
      <div className="info">{val.title}
      
      <div className="git">
     <button> <i class="fa fa-eye"> </i>View Live</button>
     <a href='https://inspiring-clafoutis-b5601d.netlify.app/'> <button> <i class="fa fa-github"></i>Code</button></a>

      </div>
      </div>
      </div>
      
     
     </>
)

    })}</div>
    </div>
  )
}
